import { Outlet, Link } from "react-router-dom";
import * as React from 'react';
import AppBar from '@mui/material/ListItemButton';
import Toolbar from '@mui/material/ListItemButton';

const Layout = () => {
  return (
    <>
      {/* <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/open-positions">Open Positions</Link>
          </li>
          <li>
            <Link to="/test2">Test2</Link>
          </li>
        </ul>
      </nav> */}

      <React.Fragment>
        <AppBar position="fixed">
          <Toolbar>{
            <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/open-positions">Open Positions</Link>
            </li>
            <li>
              <Link to="/test2">Test2</Link>
            </li>
          </ul>
            }</Toolbar>
        </AppBar>
        <Toolbar />
      </React.Fragment>
      <Outlet />
    </>
  )
};

export default Layout;
